	add("flap", "{\"term\":\"flap\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"Middle english (1100-1500) \u0027flappe|lang\u003denm\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Anything broad and flexible that hangs loose, or that is attached by one side or end and is easily moved\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Sir Thomas Brown\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a cartilaginous \u0027\u0027flap\u0027\u0027 upon the opening of the laryn\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A hinged leaf, as of a table or shutter\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A side fin of a ray - also termed a wing\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An upset, stir, scandal or controvers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The motion of anything broad and loose, or a stroke or sound made with it\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dThen he commenced to talk, really talk. and inside of two \u0027\u0027flaps\u0027\u0027 of a herring\u0027s fin he had me mesmerized, like Eben Holt\u0027s boy at the town hall show. He talked about the ills of humanity, and the glories of health and Nature and service and land knows what all\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A disease in the lips of horses\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A hinged surface on the trailing edge of the wings of an aeroplane\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A piece of tissue incompletely detached from the body, as an intermediate stage of plastic surgery\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The female genitals\", \"priority\":12}]}, \"synonyms\":{}}");

	add("flax", "{\"term\":\"flax\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) \u0027fleax\u0027 from Proto-germanic {{m|gem-pro|*flahsą}}, from Proto-indo-european {{m|ine-pro|*plek-||to plait}}. Cognate with Old Frisian \u0027flax\u0027, Old Saxon *\u0027\u0027 () (Dutch \u0027vlas\u0027 , Old High German \u0027flahs\u0027 (German \u0027flachs\u0027 ; the Northern Germanic (and most likely the Gothic too\u0026lt;ref\u0026gt;[http://germazope.uni-trier.de/Projects/WBB/woerterbuecher/dwb/wbgui?lemmode\u003dlemmasearch\u0026amp;mode\u003dhierarchy\u0026amp;textsize\u003d600\u0026amp;onlist\u003d\u0026amp;word\u003dFlachs\u0026amp;lemid\u003dGF04948\u0026amp;query_start\u003d1\u0026amp;totalhits\u003d0\u0026amp;textword\u003d\u0026amp;locpattern\u003d\u0026amp;textpattern\u003d\u0026amp;lemmapattern\u003d\u0026amp;verspattern. GF04948L0 Etymology] in the Deutsches Wörterbuch of Jakob und Wilhelm Grimm: \u0026quot;however, Old Norse hör ... The Gothic word has not been transmitted, but one might guess \u0027harvs\u0027\u0026quot;\u0026lt;/ref\u0026gt;) stem is different.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant of the genus \u0027Linum\u0027, especially , which has a single, slender stalk, about a foot and a half high, with blue flowers. Also known as linseed, especially when referring to the seeds\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The fibers of \u0027Linum usitatissimum\u0027, grown to make linen and related textiles\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The , a plant of the genus , native to New Zealand, with strap-like leaves up to 3 metres long that grow in clumps\", \"priority\":3}]}, \"synonyms\":{}}");

	add("flabbergastation", "{\"term\":\"flabbergastation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"flabbergast + -ation\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Bewildered shock or surprise; the state or condition of being flabbergasted.\u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1856. \u0027[http://books.google.com/books?id\u003dtG9MAAAAYAAJ\u0026amp;dq\u003dflabbergast\u0026amp;output\u003dtext\u0026amp;source\u003dgbs_navlinks_s Punch, Vol. 31]\u0027. The Punch Office. page 240\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We scarcely remember to have ever seen any respectable party in a greater state of \u0027\u0027flabbergastation\u0027\u0027 than the writer of some observations in Mb. Cobden\u0027s Russo-Manchesterian organ, the Morning Star, of Thursday, December the fourth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1832-1837. Honoré de Balzac. \u0027Droll Stories: Volume 2\u0027. Kessinger Publishing. page 6\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Upon a sign, she takes ahold of two cords of black silk, to which were attached loops, through which she passes her arms, and in the twinkling of an eye is translated by two pulleys from her bed through the ceiling into the room above, and the trap closing as it has opened, left the old duenna in a state of great \u0027\u0027flabbergastation\u0027\u0027, when, turning her head, she neither saw robe nor woman, and perceived that the women had been robbed\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1918. Shaw Desmond. \u0027The Soul of Denmark\u0027. C. Scribner\u0027s Sons. page 96\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I can recall my \u0027\u0027flabbergastation\u0027\u0027 when in the house of a Jutlander of the middle class I heard him holding fluent converse with his children in some heathen dialect\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1944. \u0027Field and Stream: Volume 49.\u0027 CBS Publications. page 90\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Winchester .22 Automatic which we saw demonstrated (to our utter \u0027\u0027flabbergastation\u0027\u0027) in a local hardware store by a visiting Winchester representative\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1998. \u0027Newcomer\u0027s Guide to the Afterlife: On the Other Side Known Commonly as \u0026quot;The Little Book\u0026quot;\u0027. Daniel Quinn, Tom Whalen. Random House Digital\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Ignoring the other\u0027s utter \u0027\u0027flabbergastation\u0027\u0027, Matthews turned and graciously introduced him to me\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The act of confounding or bewildering.\u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":12}]}, \"synonyms\":{}}");

	add("flabbergastment", "{\"term\":\"flabbergastment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1963. \u0027National Geographic, Vol. 122\u0027. National Geographic Society\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was the Wells-Fargo coach, the Deadwood coach of Buffalo Bill\u0027s Wild West, the coach from which steps that pulchritudinous schoolmarm from the East to the \u0027\u0027flabbergastment\u0027\u0027 of gawping cowpokes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1988. John Barth. \u0027Lost in the funhouse: fiction for print, tape, live voice\u0027. Anchor Press. page 69\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I even attempted tears myself, but \u0027\u0027flabbergastment\u0027\u0027 dried my eyes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2002. Timothy Zahn. \u0027Angelmass\u0027. Macmillan. page 175\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"She had the immense satisfaction of watching him trip over his own tongue, a look of total flabbergastment flooding over his face\", \"priority\":7}]}, \"synonyms\":{}}");

