	add("flagon", "{\"term\":\"flagon\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old high german (ca. 750-1050)\", \"old norse\"], \"text\":\"Middle english (1100-1500) \u0027flagon\u0027 () variation of Middle english (1100-1500) \u0027flakon\u0027 () from Middle french (ca. 1400-1600) \u0027flacon\u0027 from \u0027flasconem|flascōnem\u0027, accusative of \u0027flasco|flascō\u0027 \u0026quot;flask, bottle, container\u0026quot;, from Frankish \u0027flask. Frankish|flaska\u0027 \u0026quot;flask, bottle\u0026quot; from Proto-germanic {{m|gem-pro|*flaskǭ||bottle}}, from Proto-germanic {{m|gem-pro|*flehtaną||to plait, braid}}, from the practice of plaiting or wrapping bottles in straw casing. See fiasco. Akin to Old high german (ca. 750-1050) \u0027flaska\u0027 (German \u0027flasche\u0027 , Old norse \u0027flaska\u0027 () (Danish \u0027flaske\u0027 , Old english (ca. 450-1100) \u0027flasce\u0027 More at flask\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large bottle for drinks such as wine or cider\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The amount that such a bottle holds, about 1.13 litres\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A large vessel usually with a handle, spout and lid, for drinks such as wine or cider\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Fran Walsh, Philippa Boyens, \u0026amp; Peter Jackson, \u0027\u0027, 00:14:12\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;Merry and Pippin:\u0026lt;/span\u0026gt; You can drink your fancy ales / You can drink \u0027em by the \u0027\u0027flagon\u0027\u0027 / But the only brew for the brave and true / Comes from The Green Dragon\u0026lt;br /\u0026gt\", \"priority\":5}]}, \"synonyms\":{}}");

