	add("flame", "{\"term\":\"flame\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027flaume\u0027 \u0027flaumbe\u0027 blend of Anglo-norman \u0027flame\u0027 and \u0027flambe\u0027 \u0027flamble\u0027 the first from Latin \u0027flamma\u0027 the second from Latin \u0027flammula\u0027 () diminutive of \u0027flamma\u0027 both from pre-Latin *\u0027fladma\u0027; akin to Old english (ca. 450-1100) {{m|ang|glēd||ember}}; ultimately from Proto-indo-european {{m|ine-pro|*bʰlē-||to shimmer, gleam, shine}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"right|thum\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The visible part of fire; a stream of burning vapour or gas, emitting light and heat\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Long after his cigar burnt bitter, he sat with eyes fixed on the blaze. When the \u0027\u0027flames\u0027\u0027 at last began to flicker and subside, his lids fluttered, then drooped; but he had lost all reckoning of time when he opened them again to find Miss Erroll in furs and ball-gown kneeling on the hearth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/2013/4/geothermal-energy Geothermal volume\u003d101|issue\u003d4|magazine\u003d|passage\u003dEnergy has seldom been found where we need it when we want it. Ancient nomads, wishing to ward off the evening chill and enjoy a meal around a campfire, had to collect wood and then spend time and effort coaxing the heat of friction out from between sticks to kindle a \u0027\u0027flame\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A romantic partner or lover in a usually short-lived but passionate affair\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Intentionally insulting criticism or remark meant to incite anger\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A brilliant reddish orange-gold fiery colour\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The contrasting light and dark figure seen in wood used for stringed instrument making; the curl\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Burning zeal, passion, imagination, excitement, or anger\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1608-1674\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"in a \u0027\u0027flame\u0027\u0027 of zeal sever\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1688-1744\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"where \u0027\u0027flames\u0027\u0027 refin\u0027d in breasts seraphic glo\", \"priority\":13}]}, \"synonyms\":{}}");

	add("flamage", "{\"term\":\"flamage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|flame|age|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"flame postings considered as a grou\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"If you insist on posting your baby photos to that abortion newsgroup, get ready for some \u0027\u0027flamage\", \"priority\":2}]}, \"synonyms\":{}}");

	add("flambeau", "{\"term\":\"flambeau\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027flambeau\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A burning torch, especially one carried in procession\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, \u0027Constance\u0027, Faber \u0026amp; Faber 2004 (\u0027Avignon Quintet\u0027), p. 955\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"She walked quietly with apparent composure and lowered head but her pallor betrayed her mortal fear – her skin glowed almost nacrous in the warm rose of the \u0027\u0027\u0027flambeaux\", \"priority\":3}]}, \"synonyms\":{}}");

	add("flamen", "{\"term\":\"flamen\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A priest devoted to the service of a particular god, from whom he received a distinguishing epithet. The most honored were those of Jupiter, Mars, and Quirinus, called respectively Flamen Dialis, Flamen Martialis, and Flamen Quirinalis\", \"priority\":1}]}, \"synonyms\":{}}");

	add("flamenco", "{\"term\":\"flamenco\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish \u0027flamenco\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A genre of folk music and dance native to Andalusia, in Spain\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Mike Marqusee, \u0027The Guardian\u0027, 5 Feb 2010\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It\u0027s impossible to tell the story of \u0027\u0027flamenco\u0027\u0027 without talking about Lorca, who found in it a source of inspiration in a lifelong political-cultural-sexual struggle against bourgeois philistinism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A song or dance performed in such a style\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, \u0027Vieux Carré\u0027, I.3\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"La Niña was so goddam terrific that after a month of singing with the vocal trio, she was singing solo \u0027and she was dancing a \u0027\u0027flamenco\u0027\u0027 better\u0027n a gypsy fireball\", \"priority\":6}]}, \"synonyms\":{}}");

	add("flameout", "{\"term\":\"flameout\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of flaming out or burn burning out; extinguishing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of quitting or failing, especially due to overwork or in a dramatic manner\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The company was one of Silicon Valley\u0027s more famous dot-com \u0027\u0027flameout\u0027\u0027s\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The sudden extinguishing of the flame of a burner (due to obstruction of fuel\", \"priority\":4}]}, \"synonyms\":{}}");

	add("flamer", "{\"term\":\"flamer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|flame|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very flamboyant (\u0027\u0026quot;flaming\u0026quot;\u0027), effeminate gay male\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who flames, or posts vitriolic criticism\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Alex J. Packer, Pamela Espeland, \u0027How Rude\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Send a note to the \u0027\u0027flamer\u0027\u0027. Tell him that his message was inappropriate. Request that he refrain from posting anything like it again.Category:en:LGBT\", \"priority\":4}]}, \"synonyms\":{}}");

	add("flamethrower", "{\"term\":\"flamethrower\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{calque|flame|thrower|etyl lang\u003dde|etyl term\u003dFlammenwerfer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device that projects a flame for starting fires, it may also project additional fuel to help ignition. Used either as a weapon or a tool\", \"priority\":1}]}, \"synonyms\":{}}");

	add("flamingo", "{\"term\":\"flamingo\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Spanish\", \"Portuguese\"], \"text\":\"From Portuguese \u0027flamingo\u0027 from Spanish \u0027flamengo\u0027 (flame colored) from \u0027flama\u0027 (flame)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A wading bird of the family Phoenicopteridae\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A deep pink color tinged with orange, like that of a flamingo\", \"priority\":2}]}, \"synonyms\":{}}");

	add("flangeway", "{\"term\":\"flangeway\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"File:Richard Trevithick railway (England).jpg|thumb|right|A section of recreated \u0027\u0027flangeway\u0027\u0027 in EnglandFile:Tramvajska skretnica.jpg|thumb|right|A tramway junction in Zagreb showing the \u0027\u0027flangeways\u0027\u0027 for the flanges of the wheels to pass through{{compound|flange|way|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An early type of railway that used flanged rails rather than flanged wheels\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The gap in road surfaces, running rails at rails at junctions, etc, that allows the wheel flange of a rail vehicle to pass\", \"priority\":2}]}, \"synonyms\":{}}");

	add("flanging", "{\"term\":\"flanging\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a time-based audio effect produced when two identical signals are mixed together, but with one signal time-delayed by a small and gradually changing amount, usually smaller than 20 milliseconds\", \"priority\":1}]}, \"synonyms\":{}}");

	add("flanken", "{\"term\":\"flanken\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Yiddish\"], \"text\":\"From Yiddish\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A certain cut of beef used in Ashkenazic Jewish cuisine, made by cutting short ribs across the bon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Category:en:Meats\", \"priority\":2}]}, \"synonyms\":{}}");

	add("flanker", "{\"term\":\"flanker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|flank|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A player who plays in the back row of the scrum\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A wide receiver who lines up behind the line of scrimmage\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A fortification or soldier projecting so as to defend another work or to command the flank of an assailing body\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"They threw out \u0027\u0027flankers\u0027\u0027, and endeavored to dislodge their assailants\", \"priority\":4}]}, \"synonyms\":{}}");

	add("flannel", "{\"term\":\"flannel\", \"etymology\":{\"influencers\":[], \"languages\":[\"Breton\", \"Welsh\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"jèrriais\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) {{m|enm|flaunneol}}, from Anglo-norman {{m|fro|flanelle}} (compare Jèrriais {{m|nrf|flianné}}), diminutive of Old french (842-ca. 1400) {{m|fro|flaine}}, {{m|fro|floene||coarse wool}}, from Gaulish from Proto-celtic {{m|cel-pro|*wlānos}}, {{m|cel-pro|*wlanā||wool}} (compare Welsh {{m|cy|gwlân}}, Breton {{m|br|gloan}}), from Proto-indo-european {{m|ine-pro|*h₂wĺ̥h₁neh₂}}. More at \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A soft cloth material woven from wool, possibly combined with cotton or synthetic fibers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"With the weather turning colder, it was time to dig out our \u0027\u0027flannel\u0027\u0027 sheets and nightclothes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Tom Lamont, \u0027How Mumford \u0026amp; Sons became the biggest band in the world\u0027 (in \u0027The Daily Telegraph\u0027, 15 November 2012)[http://www.guardian.co.uk/music/2012/nov/15/mumford-sons-biggest-band-world\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"First singer and guitarist Marcus Mumford, wearing a black suit, then bassist Ted Dwane, in leather bomber and T-shirt. Next bearded banjo player Winston Marshall, his blue \u0027\u0027flannel\u0027\u0027 shirt hanging loose, and pianist Ben Lovett, wrapped in a woollen coat\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A washcloth\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Soothing plausible untruth and half truth, claptrap - \u0027\u0026quot;Don\u0027t talk flannel\u0026quot; [http://www.phrases.org.uk/bulletin_board/56/messages/708.html][http://dictionary.reverso.net/english-synonyms/claptrap][http://www.randomhouse.com/wotd/index.pperl?date\u003d19971103\", \"priority\":6}]}, \"synonyms\":{}}");

	add("flannelette", "{\"term\":\"flannelette\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|flannel|ette|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of soft, woven fabric, made to imitate flannel by raising or brushing the fibers in the weft. Frequently used in sleepwear, pillows, and bedding\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1954 \u0026quot;I am a draper mad with love. I love you more than all the \u0027\u0027flannelette\u0027\u0027 and calico, candlewick, dimity, crash and merino, tussore, cretonne, crepon, muslin, poplin, ticking and twill in the whole Cloth Hall of the world.\u0026quot; \u0027Dylan Thomas: Under Milk Wood. p.6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something made from this fabric\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Our \u0027\u0027flannelettes\u0027\u0027 provide an extra layer between the underquilt and sheets\", \"priority\":4}]}, \"synonyms\":{}}");

	add("flannelmouth", "{\"term\":\"flannelmouth\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|flannel|mouth|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who speaks in an unclear, muffled, or sluggish manner\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027, w:Jack Jack London, \u0027The Valley of the Moon\u0027, ch. 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Oh!—Oh!—Oh!\u0026quot; Bert screamed, with every blow she struck \u0026quot;Hey, old \u0027\u0027flannel-mouth\u0027\u0027! Watch out! You\u0027ll get yours in a second.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1943\u0027\u0027 Oct 8, \u0026quot;[http://news.google.com/newspapers?id\u003dkfIuAAAAIBAJ\u0026amp;sjid\u003dRtsFAAAAIBAJ\u0026amp;pg\u003d4202,1582289\u0026amp;dq\u003dflannelmouth+-sucker+-characin\u0026amp;hl\u003den Why Give Clues to Your Age?],\u0026quot; \u0027Ottawa Citizen\u0027 (Canada), p. 5, \u0026lt;small\u0026gt;(retrieved 11 Oct 2011)\u0026lt;/small\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Y]ou may detect your own \u0026quot;elderly\u0026quot; tricks—pushing your shoulders up around your ears, being a mumble-boy or a \u0027\u0027flannelmouth\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027 Nov. 30, w:Jeff Jeff Greenfield, \u0026quot;[http://www.time.com/time/magazine/article/0,9171,989702,00.html With Respect, You Moron...],\u0026quot; \u0027Time\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"How do they sit there, hour after hour, and listen to the congressional gasbags without blowing their tops? . . . never once leaping over the table, grabbing an inquisitor by his ears and screaming, \u0026quot;Hey, \u0027\u0027flannel mouth\u0027\u0027—does the phrase ‘posturing hypocrite windbag’ ring a bell?\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"One who speaks in a glib manner with the intent of deceiving or manipulating others\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1947\u0027\u0027 Jan. 6, George O\u0027Halloran, \u0026quot;[http://news.google.com/newspapers?id\u003dIDAaAAAAIBAJ\u0026amp;sjid\u003d2iQEAAAAIBAJ\u0026amp;pg\u003d3526,2122129\u0026amp;dq\u003dflannelmouth+-sucker+-characin\u0026amp;hl\u003den Chester the Pup],\u0026quot; \u0027Milwaukee Journal\u0027, p. 2 \u0026lt;small\u0026gt;(retrieved 11 Oct 2011)\u0026lt;/small\u0026gt\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Uncle Sedgwick, who is considered around and about as somewhat of a \u0027\u0027flannelmouth\u0027\u0027, has talked Drizzlepuss into going ice fishing. . . . Uncle can tell you some wonderful fish stories, but, boy, I\u0027ve never known a guy who\u0027s so careless with the truth\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1962\u0027\u0027 Oct. 11, w:Hal Hal Boyle, \u0026quot;[http://news.google.com/newspapers?id\u003dtK1YAAAAIBAJ\u0026amp;sjid\u003dTfcDAAAAIBAJ\u0026amp;pg\u003d3035,2752672\u0026amp;dq\u003dflannelmouth+%7C+flannel-mouth+%7C+flannel-mouth\u0026amp;hl\u003den Joy Gladly Spread],\u0026quot; \u0027Spokane Daily Chronicle\u0027, p. 4 \u0026lt;small\u0026gt;(retrieved 11 Oct 2011)\u0026lt;/small\u0026gt\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"quot;\u0027\u0027Flannelmouth\u0027\u0027 Fred\u0026quot;—He spends most of his time going around indiscriminately patting all the other employes on the back and saying \u0026quot;You\u0027re doing a grand job.\u0026quot; . . . But the rest of the hired hands . . . know that after they finish doing their work, he\u0027ll ask them to help do his\", \"priority\":12}]}, \"synonyms\":{}}");

	add("flaperon", "{\"term\":\"flaperon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|flap|aileron|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An aircraft control surface at the trailing edge of a wing that acts as an aileron (controlling movement around the longitudinal axis) and a flap (changing the chord line of the wing, thus affecting the angle of attack\", \"priority\":1}]}, \"synonyms\":{}}");

	add("flapjack", "{\"term\":\"flapjack\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pancake\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Sven ordered a stack of \u0027\u0027flapjacks\u0027\u0027 with maple syrup, two strips of bacon, and an egg, sunny side up\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A bar made of (though not limited to) rolled oats, butter, golden syrup, and brown sugar, and which is baked in a tray\", \"priority\":3}]}, \"synonyms\":{}}");

	add("flask", "{\"term\":\"flask\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Czech\", \"German\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"middle french (ca. 1400-1600)\", \"Italian\", \"Lithuanian\", \"Dutch\", \"old spanish\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027flask\u0027 (cask, keg) from \u0027flaske\u0027 (case) from Anglo-norman \u0027flascon\u0027 from {{m|la|flascō||bottle}}, from Frankish {{m|frk|*flasko}}, {{m|frk|*flaska}} (whence also Dutch \u0027fles\u0027 , from Proto-germanic {{m|gem-pro|*flaskǭ||braid-covered bottle, wicker-enclosed jug}} (whence also Old english (ca. 450-1100) \u0027flaxe\u0027 \u0027flasce\u0027 German \u0027flasche\u0027 , from Proto-indo-european {{m|ine-pro|*ploḱ-skō||flat}} (whence also Lithuanian \u0027plókščias\u0027 Czech \u0027ploský\u0027 .Sense 2 from Italian \u0027fiasco\u0027 and sense 3 from Middle french (ca. 1400-1600) \u0027flasque\u0027 (powder flask) itself from Old spanish \u0027flasco\u0027 \u0027frasco\u0027 both from Late Latin above.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A narrow-necked vessel of metal or glass, used for various purposes; as of sheet metal, to carry gunpowder in; or of wrought iron, to contain quicksilver; or of glass, to heat water in, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A container used to discreetly carry a small amount of a hard alcoholic beverage; a pocket flask\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Laboratory glassware used to hold larger volumes than test tubes, normally having a narrow mouth of a standard size which widens to a flat or spherical base\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A container for holding a casting mold, especially for sand casting molds\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A bed in a gun carriage\", \"priority\":5}]}, \"synonyms\":{}}");

	add("flashback", "{\"term\":\"flashback\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|flash|back|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a dramatic device in which an earlier event is inserted into the normal chronological flow of a narrativ\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a vivid mental image of a past trauma, especially one that recur\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a similar recurrence of the effects of a hallucinogenic dru\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the condition of the flame propagating down the hose of an oxy-fuel welding system\", \"priority\":4}]}, \"synonyms\":{}}");

	add("flashbulb", "{\"term\":\"flashbulb\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A glass bulb that made a single bright flash for illumination during a photograph\", \"priority\":1}]}, \"synonyms\":{}}");

	add("flasher", "{\"term\":\"flasher\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|flash|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Anything that flashes, especially a device that switches a light on and off\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An indicator or turn signal\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person who exposes their genitals or female nipples\", \"priority\":3}]}, \"synonyms\":{}}");

	add("flashforward", "{\"term\":\"flashforward\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|flashback|forward|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a dramatic device in which a future event is inserted into the normal chronological flow of a narrative\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, \u0026quot;Depp’s Tonto: an upgrade on a stereotype or just an updated stereotype?\u0026quot;, \u0027The Washington Post\u0027, http://www.washingtonpost.com/lifestyle/style/depps-tonto-an-upgrade-on-a-stereotype-or-just-an-updated-stereotype/2013/07/02/36017696-dea3-11e2-b2d4-ea6d8f477a01_story_1.html\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This \u0026quot;Lone Ranger\u0026quot; begins and ends in a \u0027\u0027flash-forward\u0027\u0027, with an elderly Tonto installed in a carnival diorama behind a sign that reads \u0026quot;The Noble Savage.\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("flashing", "{\"term\":\"flashing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"(weatherproofing) From original \u0027\u0027flashing material\u0027\u0027 of copper or aluminum that reflects flashes of sunlight.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Components used to weatherproof or seal roof system edges at perimeters, penetrations, walls, expansion joints, valleys, drains and other places where the roof covering is interrupted or terminated\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The process of getting rid of gaps on shelves by bringing products from the back of the shelf to the front to create a \u0027fuller\u0027 shelf\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The blinking of a light source, such as a light bulb or computer\u0027s cursor\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The incessant \u0027\u0027flashing\u0027\u0027 of the neon sign kept the neighborhood awake\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The exposing of one\u0027s naked body, or part of it, in public briefly (the action of the verb \u0027\u0027to flash\", \"priority\":5}]}, \"synonyms\":{}}");

	add("flashlight", "{\"term\":\"flashlight\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|flash|light|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A battery-powered hand-held lightsource\", \"priority\":1}]}, \"synonyms\":{}}");

	add("flashover", "{\"term\":\"flashover\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|flash|over|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The near simultaneous ignition of all combustible material in an enclosed area\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An unintended electric discharge or arc over or around an insulator\", \"priority\":2}]}, \"synonyms\":{}}");

	add("flashpacking", "{\"term\":\"flashpacking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|flash|backpacking|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a more luxurious form of backpacking with a larger budget\", \"priority\":1}]}, \"synonyms\":{}}");

	add("flatbed", "{\"term\":\"flatbed\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|flat|bed|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An open freight vehicle with no sides, designed to carry heavy or outsized loads\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A railway freight car with no sides; a flatcar\", \"priority\":2}]}, \"synonyms\":{}}");

	add("flatbread", "{\"term\":\"flatbread\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|flat|bread|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"crispbrea\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"any of various kinds of unleavened bread\", \"priority\":2}]}, \"synonyms\":{}}");

	add("flatfish", "{\"term\":\"flatfish\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fish of the order Pleuronectiformes, the adults of which have both eyes on one side and usually swim with the other side down, such as a flounder, a halibut, or a sole\", \"priority\":1}]}, \"synonyms\":{}}");

	add("flatfoot", "{\"term\":\"flatfoot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|flat|foot|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A condition in which the arch of the foot makes contact with the groun\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person having the above conditio\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"plural typically flatfoots)\u0027 A policeman\", \"priority\":3}]}, \"synonyms\":{}}");

	add("flathead", "{\"term\":\"flathead\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|flat|head|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any fish in the \u0027\u0027 family\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A type of screw designed to fit in a countersink so that it sits flush with a surface\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A type of engine that has the valves placed in the engine block beside the piston, instead of in the cylinder head, as in an overhead valve engine\", \"priority\":3}]}, \"synonyms\":{}}");

	add("flatland", "{\"term\":\"flatland\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|flat|land|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any land of relatively constant altitude (with no hills\", \"priority\":1}]}, \"synonyms\":{}}");

	add("flatlands", "{\"term\":\"flatlands\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A terrain that varies little in elevation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("flatness", "{\"term\":\"flatness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|flat|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being fla\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being two-dimensional; planar : planarit\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The state of being bland : dullnes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Mattness, the quality of a painted surface which scatters or absorbs the light falling on it, so as to be substantially free from gloss or shee\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Lack of bouquet and freshness of a wine, through too much aeration or infection with film yeast\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"slim-tailedness or platykurticity\", \"priority\":6}]}, \"synonyms\":{}}");

	add("flatterer", "{\"term\":\"flatterer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|flatter|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who flatters\", \"priority\":1}]}, \"synonyms\":{}}");

	add("flatty", "{\"term\":\"flatty\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|flat|y|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flatfis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anything flat (a flat battery, a flat tire, flat terrain etc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A policeman\", \"priority\":3}]}, \"synonyms\":{}}");

	add("flatuency", "{\"term\":\"flatuency\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"flatulence\", \"priority\":1}]}, \"synonyms\":{}}");

	add("flatulence", "{\"term\":\"flatulence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"{{PIE root|en|bʰleh₁|id\u003dblow}}From French \u0027flatulence\u0027 ultimately from Latin {{m|la|flō||breathe, blow}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of having gas, often malodorous, trapped (and often released, frequently with noise) in the digestive system of a human and some other animals; wind; and when released, a flatus, a fart\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The release of such gas, farting\", \"priority\":2}]}, \"synonyms\":{}}");

	add("flatulist", "{\"term\":\"flatulist\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|flō||breathe, blow}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An entertainer whose routine consists solely or primarily of farting in a creative, musical, or amusing manner\", \"priority\":1}]}, \"synonyms\":{}}");

	add("flatus", "{\"term\":\"flatus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Borrowed into English around 1660–1670;\u0026lt;ref name\u003d\u0026quot;D.C-etymdate\u0026quot;\u0026gt;\u0027\u0027Dictionary.com Unabridged\u0027\u0027 (v 1·1)\u0026lt;/ref\u0026gt; from Latin {{m|la|flātus||blowing, wind}}, from {{m|la|flāre||to blow}}.\u0026lt;ref name\u003d\u0026quot;COED-etym\u0026amp;pron\u0026quot;\u0026gt;The \u0027\u0027Concise Oxford English Dictionary\u0027\u0027 [Eleventh Edition]\u0026lt;/ref\u0026gt;\u0026lt;ref name\u003d\u0026quot;\u0026quot;\u0026gt;\u0027\u0027The American Heritage\u0026lt;sup\u0026gt;®\u0026lt;/sup\u0026gt; Dictionary of the English Language\u0027\u0027, Fourth Edition\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Gas generated in the digestive tract\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Expulsion of such gas through the anus\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1940\u0027\u0027: Walter Robson Humphries, \u0027William Ogilvie and the Projected Union of the Colleges, 1786–1787\u0027, [http://www.google.co.uk/books?id\u003drAU5AAAAIAAJ\u0026amp;q\u003d%22those+flatus%22\u0026amp;dq\u003d%22those+flatus%22\u0026amp;pgis\u003d1 p70\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The point of quoque with illos is that those \u0027\u0027flatus\u0027\u0027, which have the right to be called winds, are also subject to laws like the winds themselves\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027: Steve Nichols, \u0026lt;i\u0026gt;T\u0026lt;small\u0026gt;ARO\u0026lt;/small\u0026gt; of the F\u0026lt;small\u0026gt;OUR\u0026lt;/small\u0026gt; W\u0026lt;small\u0026gt;ORLDS\u0026lt;/small\u0026gt;\u0026lt;/i\u0026gt;, [http://www.google.co.uk/books?id\u003dfdcJgZSXF7wC\u0026amp;pg\u003dPA139\u0026amp;dq\u003d%22those+flatus%22\u0026amp;sig\u003dMmGqhOJnR92T5eq7nnMvTo0-4Ro p139] (ISBN 1874603073\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"And as they perceived in her sundry natures, and divers properties, so they ascribed unto her divers and several names, and erected Statues and Altars unto her, according to those names, under which they then so worshipped and adored her, who (as I have already written) was with many taken and understood for Juno: and those \u0027\u0027flatus\u0027\u0027 and images which were dedicated unto her, were made also many times of many other goddesses: whose properties signified them to be in nature the same as the earth, as first Lagran Madre, la Madre de i dei, Ope (Ops), Phes, Cibelle, Vesta, Ceres, Proserpina, and many others which of their places and habitations where they then remained, had their names accordingly, all signifying one \u0026amp; the same thing, being as I have said, the Earth, for which indeed, \u0026amp; from whose fruits, all things here in the world seem to receive their life and being, and are nourished \u0026amp; conserved by these fertileness thereof, and in this respect she was called the mother of the gods, insomuch, as all those gods of the Ancients, which were so superstitiously adored and held in that respective regardance, lived here once on the earth, and were fed and maintained by the increases, fruits, \u0026amp; suppeditaments thereof\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027: Harold John Cook, \u0027Matters of Exchange: Commerce, Medicine, and Science in the Dutch Golden Age\u0027, [http://www.google.co.uk/books?id\u003dhaiG4P79gysC\u0026amp;pg\u003dPA373\u0026amp;dq\u003d%22those+flatus%22\u0026amp;sig\u003dcHZUIYpx8wHp-Z7T8dLU-UuJFPo p373] (ISBN 9780300117967\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A long summary of the work quickly appeared in the Royal Society’s \u0027Philosophical Transactions\u0027, which began with the theory Ten Rhijne’s had adapted from his Japanese colleagues: “This Author treating of the \u0027Gout\u0027, … asserts Flatus or Wind included between the \u0027Periosteum\u0027 and the bone to be the genuine producer of those intolerable Pains … and that all the method of cure ought to tend toward the dispelling those \u0027\u0027\u0027Flatus\u0027\u0027\u0027”.\u0026lt;sup\u0026gt;156\u0026lt;/sup\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Morbid inflation or swelling\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1730\u0027\u0027 April, w:Jonathan Jonathan Swift, \u0026quot;A Vindication of the Lord Carteret\u0026quot;, in Thomas Sheridan and John Nichols (Eds.), \u0027The Works of the Rev. Jonathan Swift, D.D., Dean of St. Patrick’s, Dublin\u0027, Volume IX, J. Johnson \u0026amp;amp;c. (1801), [http://books.google.com/books?id\u003dbTQ_Kakq8rUC\u0026amp;pg\u003dPA226\u0026amp;dq\u003dflatuses page 226\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"…] an incensed political surgeon, who is not in much renown for his mercy, upon great provocations: who, without waiting for his death, will flay and dissect him alive; and to the view of mankind lay open all the disordered cells of his brain, the venom of his tongue, the corruption of his heart, and spots and \u0027\u0027flatuses\u0027\u0027 of his spleen: and all this for threepence\", \"priority\":11}]}, \"synonyms\":{\"list\":[{\"text\":\"fart\", \"synonymQualifier\":\"VULGAR\"}]}}");

