	add("flavour", "{\"term\":\"flavour\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) meaning \u0026quot;smell, odor\u0026quot;, usually pleasing, from Old french (842-ca. 1400) \u0027flaour\u0027 (lang\u003dfro) from \u0027flator\u0027 (lang\u003dla) from Latin \u0027flator\u0027 (lang\u003dla) from \u0027flo\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality produced by the sensation of taste or, especially, of taste and smell in combined effect\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027flavour\u0027\u0027 of this apple pie is delicious\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A substance used to produce a taste. Flavouring\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Flavour\u0027\u0027 was added to the pudding\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A variety (of taste) attributed to an object\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"What \u0027\u0027flavour\u0027\u0027 of bubble gum do you enjoy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The characteristic quality of something\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027flavour\u0027\u0027 of an experience\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A kind or type\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Debian is one \u0027\u0027flavour\u0027\u0027 of the Linux operating system\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"One of the six types of quarks (top, bottom, strange, charmed, up, and down) or three types of leptons (electron, muon, and tauon\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The quality produced by the sensation of smell; odour; fragrance\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027flavour\u0027\u0027 of a rose\", \"priority\":13}]}, \"synonyms\":{}}");

